(67, 4, '2012-04-24 00:32:40', 'Magento Community Preview Version CE 1.7.0.0-RC1 has been released!', 'Learn more about the exciting new features and updates in this release and how you can take it for a test drive. As this is a preview version, we need to stress that it''s likely unstable and that we DON''T recommend that you use it in any production environment just yet.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-ce-1700-rc1-now-available/', 0, 1),
(68, 4, '2012-05-11 20:16:54', 'Magento Community 1.7 and Magento Enterprise 1.12 now available!', 'Learn more about the exciting new features and updates in these releases.', 'http://www.magentocommerce.com/blog/comments/magento-enterprise-112-and-community-17-now-available/', 0, 1),
(69, 4, '2012-06-21 05:24:07', 'Magento Community Edition 1.7.0.1 now available! ', 'We have just released an updated version of Magento Community Edition, version 1.7.0.1. This update delivers new, minor functionality and fixes for some potential security vulnerabilities.', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1701-released/', 0, 1),
(70, 4, '2012-07-06 05:51:43', 'Important Security Update - Zend Platform Vulnerability', 'We have recently learned of a serious vulnerability in the Zend platform on which Magento is built. Learn more and access a patch that addresses this issue. ', 'http://www.magentocommerce.com/blog/comments/important-security-update-zend-platform-vulnerability/', 0, 1),
(71, 4, '2012-08-25 09:07:47', 'Increase Your Sales With PayPal', 'Magento merchants using PayPal Express Checkout can help increase their sales on average 18%. It is one simple thing you can do right now to help boost your sales. Learn more.', 'http://www.magentocommerce.com/add-paypal?utm_source=CEModule&utm_medium=copy&utm_content=18&utm_campaign=choosepaypal', 0, 1),
(72, 3, '2009-10-20 02:40:52', 'Magento Beanstream Interac Module updated', '<p>Bug fikxes and namespace change to the Magento Beanstream interac Payment module.&nbsp;</p>\n<p>Installing the new version will require removing the previous version completely.</p>\n<p><img src="https://collinsharper.com/blog_rss_tracking.jpg.php?entry=interac_update" border="0" width="15" height="15" style="border: 0;" /></p>', 'http://www.collinsharper.com/ecommerce_updates/magento_beanstream_interac_payment_module/', 0, 1),
(73, 3, '2009-10-24 11:43:04', 'Magento Beanstream CC Module Updated', '<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Updated Beanstream Credit Card module to show receipt information to the customer as per requirements. <img src="https://collinsharper.com/blog_rss_tracking.jpg.php?entry=beanstream_cc" border="0" width="15" height="15" style="border: 0px initial initial;" /></span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; white-space: normal;"> </span></span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Moved instructions to website - please refer to&nbsp;<span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; white-space: normal;"><a href="http://www.collinsharper.com/index.php/website-modules/magento-modules/magento-beanstream-credit-card-payment-module.html">http://www.collinsharper.com/index.php/website-modules/magento-modules/magento-beanstream-credit-card-payment-module.html</a><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;"> for update / installation instuctions.</span></span></span></span></p>\n<div><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Changed namespacing.</span></div>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">updated logging to give more verbose output in test mode</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"><br /></span></span></p>', 'http://www.collinsharper.com/ecommerce_updates/Magento_Beanstream_CC_Module_Updated/', 0, 1),
(74, 3, '2009-10-27 03:17:12', 'NEW! Magento Admin sales source tracking module', '<p>A new opensource module to track agent sales for reporting on Magento sales agent commissions etc.&nbsp;<img src="https://collinsharper.com/blog_rss_tracking.jpg.php?entry=sales_source" border="0" width="15" height="15" /></p>\n<p>check it out&nbsp;<a href="http://www.collinsharper.com/index.php/website-modules/magento-modules/magento-sales-admin-user-record.html">http://www.collinsharper.com/index.php/website-modules/magento-modules/magento-sales-admin-user-record.html</a></p>', 'http://www.collinsharper.com/ecommerce_updates/magento_sales_source_agent_tracking/', 0, 1),
(75, 3, '2009-11-18 07:06:19', 'Magento Product Feed Generator', '<p>Module to generate product feeds for magento.<img src="https://collinsharper.com/blog_rss_tracking.jpg.php?entry=product_feeds" border="0" /></p>\n<p>read more on the product page</p>\n<p><a href="http://www.collinsharper.com/index.php/website-modules/magento-modules/magento-product-feed-generator.html">http://www.collinsharper.com/index.php/website-modules/magento-modules/magento-product-feed-generator.html</a></p>', 'http://www.collinsharper.com/ecommerce_updates/magento_product_feeds/', 0, 1),
(76, 3, '2010-06-18 01:08:32', 'Magento Beanstream Credit Card Payment Module', '<div style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; margin: 8px;">\n<p><br />Updates to the&nbsp;Magento Beanstream Credit Card Payment Module for the 1.4 series of Mangento have been released.</p>\n<p><img src="https://collinsharper.com/blog_rss_tracking.jpg.php?entry=beanstreamcc_update" border="0" width="15" height="15" style="border: 0;" /></p>\n<p><a href="http://www.collinsharper.com/magento-beanstream-credit-card-payment-module.html">http://www.collinsharper.com/magento-beanstream-credit-card-payment-module.html</a></p>\n</div>\n<p>&nbsp;</p>', 'http://www.collinsharper.com/ecommerce_updates/Magento-Beanstream-Credit-Card-Payment-Module/', 0, 1),
(77, 3, '2010-08-22 02:04:03', 'Beanstream Interac Update for Mage CE 1.4.x', '<p>Magento Beanstream Interac module updated for CE 1.4.x</p>', 'http://www.collinsharper.com/ecommerce_updates/beanstream_interac_update_magento/', 0, 1),
(78, 4, '2012-11-20 07:57:42', 'Wrap up more holiday sales with financing', 'Give your customers up to 6 months financing. You get paid right away with Bill Me Later, a PayPal service. It’s a great way to extend financing in time for the holidays. Learn More.', 'http://www.magentocommerce.com/paypal/billmelater?utm_source=CEMessaging&utm_medium=copy&utm_content=sixmonths&utm_campaign=BML', 0, 1),
(79, 3, '2009-10-24 09:57:51', 'Magento Documentation Doxygen', '<p>Ran Doxygen on an older version of the magento tree.</p>\n<p><a href="http://collinsharper.com/magento_documentation/">http://collinsharper.com/magento_documentation/</a></p>\n<p>&nbsp;</p>\n<p>Somewhat helpful, need to run it again with a new version and turn down some of the settings I am thinking.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 'http://www.collinsharper.com/ecommerce_updates/magento_documention_doxygen/', 0, 1),
(80, 3, '2009-10-28 01:44:30', 'Magento Email Spam and a fix', '<p>It is really frustrating when your email comes through as spam</p>\n<p><span style="font-family: arial, sans-serif; font-size: 13px; border-collapse: collapse;">Spam detection software, running on the system &lt;&lt;yourserver.name.here&gt;&gt;, has<br />identified this incoming email as possible spam. &nbsp;The original message<br />has been attached to this so you can view it (if it isn''t spam) or label<br />similar future email. &nbsp;If you have any questions, see<br />the administrator of that system for details.<br /><br />Content preview: &nbsp;Dear valued customer, Your order # 100000009 has been Canceled.<br />&nbsp; You can check the status of your order by logging into your account.<br />&nbsp;[...]<br /><br />Content analysis details: &nbsp; (6.7 points, 5.0 required)<br /><br />&nbsp;pts rule name &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;description<br />---- ---------------------- --------------------------------------------------<br />&nbsp;2.4 HTML_IMAGE_ONLY_20 &nbsp; &nbsp; BODY: HTML: images with 1600-2000 bytes of words<br />&nbsp;0.0 HTML_MESSAGE &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; BODY: HTML included in message<br />&nbsp;2.3 MIME_HTML_ONLY &nbsp; &nbsp; &nbsp; &nbsp; BODY: Message only has text/html MIME parts<br />&nbsp;1.7 HTML_MIME_NO_HTML_TAG &nbsp;HTML-only message, but there is no HTML tag<br />&nbsp;0.3 HTML_SHORT_LINK_IMG_3 &nbsp;HTML is very short with a linked image<br />&nbsp;0.1 RDNS_NONE &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Delivered to trusted network by a host with no rDNS<br />-0.0 AWL &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;AWL: From: address is in the auto white-list<br /><br />The original message was not completely plain text, and may be unsafe to<br />open with some email clients; in particular, it may contain a virus,<br />or confirm that your address can receive spam. &nbsp;If you wish to view<br />it, it may be safer to save it to a file and open it with an editor.</span></p>\n<p><span style="font-family: arial, sans-serif; font-size: small;"><span style="border-collapse: collapse; font-size: 13px;"><br /></span></span></p>\n<p><span style="font-family: arial, sans-serif; font-size: small;"><span style="border-collapse: collapse; font-size: 13px;"><br /></span></span></p>\n<p><span style="font-family: arial, sans-serif; font-size: small;"><span style="border-collapse: collapse; font-size: 13px;"><br /></span></span></p>\n<p>This was pretty frustrating. So I first created a small Model override that added some proper content to the email so it would not be flagged.</p>\n<p>&nbsp;</p>\n<p>This did not get the results wanted the message was still flagged. I ended up changing a core file.</p>\n<p>&nbsp;</p>\n<p>You can grab the module here; it is donationware; depending on the results, we may release more in this manor.</p>\n<p><a href="http://www.collinsharper.com/index.php/magento-email-spam-fix.html">http://www.collinsharper.com/index.php/magento-email-spam-fix.html</a></p>\n<p>&nbsp;</p>\n<p>Let me know how it works out for you.</p>\n<p>&nbsp;</p>', 'http://www.collinsharper.com/ecommerce_updates/magento_email_spam_fix/', 0, 1),
(81, 3, '2009-10-29 17:39:47', 'Magento Layered Navigation Fix', '<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre-wrap;">Just a short note for now. We were having issues on a site with 19 stores 500 products and way too many attributes.</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre-wrap;">Layered navigation would not finish / update properly.</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre-wrap;">We tested the script by </span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre-wrap;">\n<p>//# Magento Layered Nav - Badger || Duck</p>\n<p>//# @author: Chris McKee [chrismckee.co.uk]</p>\n<p>&nbsp;</p>\n<p>it would leave the nav missing some attributes and we could not get all the stores to update.</p>\n<p>&nbsp;</p>\n<p>Ended up with a basic script like the following, ran it in the shell and it did the trick.</p>\n<p>&nbsp;</p>\n<p>require_once("app/Mage.php"); 	Mage::app(''admin'');  	Mage::setIsDeveloperMode(true);     			mage::log("Clear Cache "); 			Mage::app()-&gt;cleanCache(); 			$flag = Mage::getModel(''catalogindex/catalog_index_flag'')-&gt;loadSelf(); 			if ($flag-&gt;getState() == Mage_CatalogIndex_Model_Catalog_Index_Flag::STATE_RUNNING) { 				$flag-&gt;delete(); 							mage::log("Delete Flag".$flag-&gt;getState()); 				} 			Mage::getSingleton(''catalogindex/indexer'')-&gt;plainReindex(null, null, null);</p>\n<div></div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</span></span></p>', 'http://www.collinsharper.com/ecommerce_updates/magento_layered_navigation_fix/', 0, 1),
(82, 3, '2009-11-08 12:31:47', 'Reset test data on magento store', '<p>Heres a quick query to purge all test data except customers.</p>\n<p>&nbsp;</p>\n<p>\n<p>SET FOREIGN_KEY_CHECKS=0;</p>\n<p>TRUNCATE `catalogsearch_query`;</p>\n<p>ALTER TABLE `catalogsearch_query` AUTO_INCREMENT=1;</p>\n<p>TRUNCATE `sales_order`;</p>\n<p>TRUNCATE `sales_order_datetime`;</p>\n<p>TRUNCATE `sales_order_decimal`;</p>\n<p>TRUNCATE `sales_order_entity`;</p>\n<p>TRUNCATE `sales_order_entity_datetime`;</p>\n<p>TRUNCATE `sales_order_entity_decimal`;</p>\n<p>TRUNCATE `sales_order_entity_int`;</p>\n<p>TRUNCATE `sales_order_entity_text`;</p>\n<p>TRUNCATE `sales_order_entity_varchar`;</p>\n<p>TRUNCATE `sales_order_int`;</p>\n<p>TRUNCATE `sales_order_text`;</p>\n<p>TRUNCATE `sales_order_varchar`;</p>\n<p>TRUNCATE `sales_flat_quote`;</p>\n<p>TRUNCATE `sales_flat_quote_address`;</p>\n<p>TRUNCATE `sales_flat_quote_address_item`;</p>\n<p>TRUNCATE `sales_flat_quote_item`;</p>\n<p>TRUNCATE `sales_flat_quote_item_option`;</p>\n<p>TRUNCATE `sales_flat_order_item`;</p>\n<p>TRUNCATE `sendfriend_log`;</p>\n<p>TRUNCATE `tag`;</p>\n<p>TRUNCATE `tag_relation`;</p>\n<p>TRUNCATE `tag_summary`;</p>\n<p>TRUNCATE `wishlist`;</p>\n<p>TRUNCATE `log_quote`;</p>\n<p>TRUNCATE `report_event`;</p>\n<p>TRUNCATE `log_customer`;</p>\n<p>TRUNCATE `log_quote`;</p>\n<p>TRUNCATE `log_summary`;</p>\n<p>TRUNCATE `log_summary_type`;</p>\n<p>TRUNCATE `log_url`;</p>\n<p>TRUNCATE `log_url_info`;</p>\n<p>TRUNCATE `log_visitor`;</p>\n<p>TRUNCATE `log_visitor_info`;</p>\n<p>TRUNCATE `log_visitor_online` ;</p>\n<p>ALTER TABLE `log_customer` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_quote` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_summary` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_summary_type` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_url` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_url_info` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_visitor` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_visitor_info` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_visitor_online` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_datetime` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_decimal` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_entity` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_entity_datetime` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_entity_decimal` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_entity_int` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_entity_text` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_entity_varchar` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_int` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_text` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_order_varchar` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_flat_quote` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_flat_quote_address` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_flat_quote_address_item` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_flat_quote_item` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_flat_quote_item_option` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sales_flat_order_item` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `sendfriend_log` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `tag` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `tag_relation` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `tag_summary` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `wishlist` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `log_quote` AUTO_INCREMENT=1;</p>\n<p>ALTER TABLE `report_event` AUTO_INCREMENT=1;</p>\n<p>&nbsp;</p>\n<p>SET FOREIGN_KEY_CHECKS=1;</p>\n</p>', 'http://www.collinsharper.com/ecommerce_updates/magento_reset_order_data/', 0, 1);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(83, 3, '2009-12-06 03:31:17', 'Ecommerce, Security, Cheap SSL, Godaddy,  2048 bit what?!?', '<p><sub>(* for all you impatient people, here it is </sub><a href="/csr_generation.php" target="_blank" title="2038 bit private key / CSR Generation"><span style="color: #000000;"><span style="text-decoration: none;"><span style="color: #000000;"><span style="text-decoration: none;"><sub>2048 bit Private Key / CSR Generation</sub></span></span></span></span></a><sub> )</sub></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;"> We run some management system for all our clients / domains.</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">It''s pretty easy to use when it comes to management tasks,&nbsp;</span></p>\n<p>&nbsp;</p>\n<ul>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Email</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Adding Domains</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Managing Nameservers / Hostnames</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">FTP accounts</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">SSL Certificates</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"><br /></span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Yeah.. SSL Certificates.&nbsp;</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">So if your going to have an Ecommerce site and accept credit card / payment data on</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"> your site without redirection to like paypal, PCI compliance (*<span style="font-family: arial, sans-serif; font-size: small; white-space: normal;">Payment Card Industry (<em style="font-weight: bold; font-style: normal;">PCI</em>) Data Security Standard) requires you to have an SSL (https) enabled website so that your customers financial data is mostly more secure. So to get an SSL certificate you have a few options</span></span></span></p>\n<p>&nbsp;</p>\n<ul>\n<li><span style="font-family: arial, sans-serif; font-size: small;">Don''t</span></li>\n<li><span style="font-family: arial, sans-serif; font-size: small;">Create a Self Signed Certificate</span></li>\n<li><span style="font-family: arial, sans-serif; font-size: small;">Create a Certificate Request and get it signed by someone who the majority&nbsp;of browsers already trust</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"><span style="font-family: arial, sans-serif; font-size: small; white-space: normal;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;"> We will skip the Don''t part.</span></span></span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">We normally use Godaddy for SSL''s; no real reason, I started buying domains though</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;"> them a while back&nbsp;and it''s just easier to get all your domains, SSL Certificates in the&nbsp;</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">same place. (*Short of my .ca domains which I''m pretty</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"> sure Godaddy still doesn''t offer.)</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"><br /></span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Right Godaddy SSL certificates.&nbsp;</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">I dont remember the price; but for all you recession feeling people if you google&nbsp;</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">(*or bing?!?!)  <strong>SSL certificates</strong></span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"> godaddy is listed at the top of the page.</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Ok so until recently this was an easy process hit the management software</span></span></p>\n<p>&nbsp;</p>\n<ul>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;"> Enter some basic required information</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Request a self signed certificate</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Goto Godaddy</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Put in Certificate Request and submit</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Wait for email</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12px; white-space: pre;">Add Signed Certificates, Key &amp; Intermediary Certificate to management software &amp; apply settings</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">And your done! (*doesn''t look that easy huh?)</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Well now godaddy requires 2048 bit Private keys and our management software does not support it.&nbsp;</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">If your SSH / console friendly or have cygwin/ openSSL you can try this</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">(*note collinsharper.com should probably be replaced with your domain )</span></span></p>\n<pre>openssl genrsa -out collinsharper.com.key 2048<br /></pre>\n<pre>openssl req -new -key collinsharper.com.key -out collinsharper.com.csr<br /></pre>\n<pre>cat&nbsp;collinsharper.com.key<br /></pre>\n<pre>cat&nbsp;collinsharper.com.csr<br /></pre>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">Its going to ask you a few questions</span></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;">and look something like this</span></span></p>\n<pre><br /></pre>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="font-size: 12px; white-space: pre;"> </span></span></p>\n<pre>[openssl@collinsharper ~]# openssl genrsa -out collinsharper.com.key 2048<br /></pre>\n<pre>[openssl@collinsharper ~]# openssl req -new -key collinsharper.com.key -out collinsharper.com.csr<br /></pre>\n<pre>You are about to be asked to enter information that will be incorporated<br /></pre>\n<pre>into your certificate request.<br /></pre>\n<pre>What you are about to enter is what is called a Distinguished Name or a DN.<br /></pre>\n<pre>There are quite a few fields but you can leave some blank<br /></pre>\n<pre>For some fields there will be a default value,<br /></pre>\n<pre>If you enter ''.'', the field will be left blank.<br /></pre>\n<pre>-----<br /></pre>\n<pre>Country Name (2 letter code) [GB]:CA<br /></pre>\n<pre>State or Province Name (full name) [Berkshire]:BC<br /></pre>\n<pre>Locality Name (eg, city) [Newbury]:Vancouver<br /></pre>\n<pre>Organization Name (eg, company) [My Company Ltd]:Collins Harper<br /></pre>\n<pre>Organizational Unit Name (eg, section) []:Magento Development Web Sales<br /></pre>\n<pre>Common Name (eg, your name or your server''s hostname) []:www.collinsharper.com<br /></pre>\n<pre>Email Address []:stopspammingme@collinsharper.com<br /></pre>\n<pre><br /></pre>\n<pre>Please enter the following ''extra'' attributes<br /></pre>\n<pre>to be sent with your certificate request<br /></pre>\n<pre>A challenge password []:<br /></pre>\n<pre>An optional company name []:<br /></pre>\n<pre><br /></pre>\n<pre>[openssl@collinsharper ~]# cat collinsharper.com.key<br /></pre>\n<pre>-----BEGIN RSA PRIVATE KEY-----<br /></pre>\n<pre>MIIEowIBAAKCAQEA0MXEo67NsPbR/ge/Gka+GfoTzrEEMQqgmlvZXFzvQP9n+tPW<br /></pre>\n<pre>--- data clipped ---<br /></pre>\n<pre>+rxNk1B9OrSDDgwXLUo6DQEDxhj6XW8oNeJUCmnsZAXbmq7N9V58<br /></pre>\n<pre>-----END RSA PRIVATE KEY-----<br /></pre>\n<pre><br /></pre>\n<pre>[openssl@collinsharper ~]# cat collinsharper.com.csr<br /></pre>\n<pre>-----BEGIN CERTIFICATE REQUEST-----<br /></pre>\n<pre>hPI7jFC1JXXdzu5zh5liEy/HRXDr3xvBaTPqdLk1fhkhqlVn77qTW6jLoscWXHWQ<br /></pre>\n<pre>--- data clipped ---<br /></pre>\n<pre>ehvTPwttZlVB+A==<br /></pre>\n<pre>-----END CERTIFICATE REQUEST-----<br /></pre>\n<p>&nbsp;</p>\n<p>Thats not so bad just take that and follow the previous steps.</p>\n<p>That does mean for all my clients I have to generate their certificates; I don''t really like repetitive tasks.</p>\n<p>So heres a fairly simple script.</p>\n<p><a href="../../../../../../../../csr_generation.php" target="_blank" title="2048 bit Private Key / CSR Generation">2048 bit Private Key / CSR Generation</a></p>\n<p>Generate&nbsp;</p>\n<p>&nbsp;</p>\n<ul>\n<li>A 2048 bit Private key pair</li>\n<li>A CSR</li>\n<li>Even a Self Signed Certificate</li>\n</ul>\n<p>&nbsp;</p>\n<p>you will need to save both keys and the CSR for future use.</p>\n<p>One last thing - take your time and read the data from your parsed Certificate, they teach nurses to read data backwards then forwards (you don''t skim as well reading data backwards or so I am told), this will force you to think about the information and ensure you do not request a bad&nbsp;certificate&nbsp;then have to start over.</p>\n<p>&nbsp;</p>', 'http://www.collinsharper.com/ecommerce_updates/ecommerce_security_cheap_ssl_godaddy_2048_bit/', 0, 1),
(84, 3, '2009-12-06 04:05:17', 'Fixing Magento Errors', '<p>One of the best kept secrets that techs love; when your computer is dong something it shouldn''t; reboot it.</p>\n<p>&nbsp;</p>\n<p>So what do we do when Magento is not responding or playing nice?</p>\n<p>\n<ul>\n<li>Magento Blank Screen</li>\n<li>Admin redirecting to dashboard</li>\n<li>Magento Report Error</li>\n<li>Memory limit issue</li>\n</ul>\n<div>Hopefully this is your Magento Development system and not your live site.&nbsp;</div>\n<div>To begin with most php errors are easier to troubleshoot with the following in your .htaccess file</div>\n<div></div>\n<div>\n<div><em>php_flag display_startup_errors on</em></div>\n<div><em>php_flag display_errors on</em></div>\n<div><em>php_flag html_errors on</em></div>\n</div>\n</p>\n<p>Other Magento specific options depending on the size of your database, how much your processing / crunching and what your trying to upload.</p>\n<p>\n<p><em>&nbsp;&nbsp; php_value memory_limit 256M<br />&nbsp;&nbsp; php_value max_execution_time 600<br />&nbsp;&nbsp; php_value post_max_size 8M&nbsp;<br />&nbsp;&nbsp; php_value upload_max_filesize 8M</em><span style="white-space: pre;"><em> </em></span></p>\n<div>If your curious what these do, checkout the php.net website (it''s amazing)</div>\n<div></div>\n<div>Next turn off caching</div>\n<div>\n<ul>\n<li>Login to your Magento admin</li>\n<li>Goto the Top right System Menu&nbsp;</li>\n<li>Cache Management</li>\n<li>In the Drop down for All cache</li>\n<li>Disable</li>\n<li>Save Cache Settings</li>\n</ul>\n<div></div>\n<div>And finally turn on Magento System Logging</div>\n<div>\n<ul>\n<li>Login to your Magento admin</li>\n<li>Goto the Top right System Menu&nbsp;</li>\n<li>Configuration</li>\n<li>On the bottom Left of the Navigation</li>\n<li>Developer</li>\n<li>Then Log Settings</li>\n<li>Set it to Yes</li>\n<li>Save config</li>\n</ul>\n<div>You now need to get into your FTP and ensure the var/log folder exists and for simplicity you can make it world&nbsp;writable (*777)</div>\n<div></div>\n<div>This should allow you to troubleshoot most everything with Magento.</div>\n<div></div>\n</div>\n</div>\n</p>', 'http://www.collinsharper.com/ecommerce_updates/fixing_magento_errors/', 0, 1),
(85, 3, '2009-12-19 07:52:14', 'Magento Inline Translation Function', '<p>Just a quick note.</p>\n<p>if you are working with a multi language site and need to do some translation that was missed / skipped in a module.</p>\n<p>You might not have to deal with ftp / editors and such. Try the following.</p>\n<p>as long as they are outputting the text properly ($this-&gt;__(''translatable text goes here''))</p>\n<p>you can go into your magento admin</p>\n<p>click System</p>\n<p>Click Configuration</p>\n<p>Click Development in the left menu</p>\n<p>&nbsp;</p>\n<p>Expand Translate Inline, then enable it</p>\n<p>Save your changes</p>\n<p>&nbsp;</p>\n<p>Now click &nbsp;System</p>\n<p>Configuration</p>\n<p>Cache Management</p>\n<p>De Select the cache for Translations and save your changes.</p>\n<p>&nbsp;</p>\n<p>Now you can goto your front end and add in translations.&nbsp;</p>\n<p>&nbsp;</p>', 'http://www.collinsharper.com/ecommerce_updates/magento_translation_multilanguage/', 0, 1),
(86, 3, '2009-12-30 10:12:48', 'Magento Shipment Export - Canada Post', '<p>Module to export Shipments to Canada post has been updated.</p>\n<p>It now works with Canada Post EST Desktop 2.0</p>\n<p>It exports line type 5 for Canadian orders as well as Line types 6 &amp; 7 for USA / foreign orders.</p>\n<p>It will cover all&nbsp;requirements&nbsp;for harm code insertion also if you have your catalog configured accordingly.<br /><br /></p>\n<p><a href="http://www.collinsharper.com/magento-canada-post-vcd-export-module.html">http://www.collinsharper.com/magento-canada-post-vcd-export-module.html</a></p>\n<p>&nbsp;</p>', 'http://www.collinsharper.com/ecommerce_updates/Magento_Shipment_Export-Canada_Post/', 0, 1),
(87, 3, '2010-03-19 01:32:39', 'Invalid model for shipping method', '<p>You ever get this error?</p>\n<p><span style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #2f2f2f; line-height: 19px;">\n<pre style="padding: 0px; margin: 0px;">Invalid model for shipping method - and your baffled?</pre>\n<pre style="padding: 0px; margin: 0px;">Simplest solution is to reinstall the shipping module you uninstalled and just disable it</pre>\n<pre style="padding: 0px; margin: 0px;"><br /></pre>\n<pre style="padding: 0px; margin: 0px;"><span style="font-family: Arial, Helvetica, sans-serif; white-space: normal; font-size: 12px; color: #2f2f2f;"><pre style="padding: 0px; margin: 0px;"><br /></pre>\n<pre style="padding: 0px; margin: 0px;"><br /></pre>\n<pre style="padding: 0px; margin: 0px;">#0 ...src/Mage_Shipping_Model_Config.php(104): Mage::exception(''Mage_Shipping'', ''Invalid model f...'')\n#1 ...src/Mage_Shipping_Model_Config.php(64): Mage_Shipping_Model_Config-&gt;_getCarrier(''ideletedashippingmodule'', Array, ''1'')\n#2 ...src/Mage_Adminhtml_Block_Sales_Order_Invoice_Create_Tracking.php(89): Mage_Shipping_Model_Config-&gt;getAllCarriers(''1'')\n#3 /var/www/html/mage14/app/design/adminhtml/default/default/template/sales/order/invoice/create/tracking.phtml(91): Mage_Adminhtml_Block_Sales_Order_Invoice_Create_Tracking-&gt;getCarriers()\n#4 ...src/__default.php(2634): include(''/var/www/html/m...'')\n#5 ...src/__default.php(2670): Mage_Core_Block_Template-&gt;fetchView(''adminhtml/defau...'')\n#6 ...src/__default.php(2687): Mage_Core_Block_Template-&gt;renderView()\n#7 ...src/Mage_Adminhtml_Block_Template.php(81): Mage_Core_Block_Template-&gt;_toHtml()\n#8 ...src/__default.php(2074): Mage_Adminhtml_Block_Template-&gt;_toHtml()\n#9 ...src/__default.php(1916): Mage_Core_Block_Abstract-&gt;toHtml()\n#10 ...src/__default.php(1867): Mage_Core_Block_Abstract-&gt;_getChildHtml(''tracking'', false)\n#11 /var/www/html/mage14/app/design/adminhtml/default/default/template/sales/order/invoice/create/form.phtml(80): Mage_Core_Block_Abstract-&gt;getChildHtml(''tracking'', false)\n#12 ...src/__default.php(2634): include(''/var/www/html/m...'')\n#13 ...src/__default.php(2670): Mage_Core_Block_Template-&gt;fetchView(''adminhtml/defau...'')\n#14 ...src/__default.php(2687): Mage_Core_Block_Template-&gt;renderView()\n#15 ...src/Mage_Adminhtml_Block_Template.php(81): Mage_Core_Block_Template-&gt;_toHtml()\n#16 ...src/__default.php(2074): Mage_Adminhtml_Block_Template-&gt;_toHtml()\n#17 ...src/__default.php(1916): Mage_Core_Block_Abstract-&gt;toHtml()\n#18 ...src/__default.php(1867): Mage_Core_Block_Abstract-&gt;_getChildHtml(''form'', true)\n#19 ...src/Mage_Adminhtml_Block_Widget_Form_Container.php(130): Mage_Core_Block_Abstract-&gt;getChildHtml(''form'')\n#20 /var/www/html/mage14/app/design/adminhtml/default/default/template/widget/form/container.phtml(37): Mage_Adminhtml_Block_Widget_Form_Container-&gt;getFormHtml()\n#21 ...src/__default.php(2634): include(''/var/www/html/m...'')\n#22 ...src/__default.php(2670): Mage_Core_Block_Template-&gt;fetchView(''adminhtml/defau...'')\n#23 ...src/__default.php(2687): Mage_Core_Block_Template-&gt;renderView()\n#24 ...src/Mage_Adminhtml_Block_Template.php(81): Mage_Core_Block_Template-&gt;_toHtml()\n#25 ...src/Mage_Adminhtml_Block_Widget_Container.php(295): Mage_Adminhtml_Block_Template-&gt;_toHtml()\n#26 ...src/__default.php(2074): Mage_Adminhtml_Block_Widget_Container-&gt;_toHtml()\n#27 ...src/__default.php(10830): Mage_Core_Block_Abstract-&gt;toHtml()\n#28 ...src/__default.php(2074): Mage_Core_Block_Text_List-&gt;_toHtml()\n#29 ...src/__default.php(1916): Mage_Core_Block_Abstract-&gt;toHtml()\n#30 ...src/__default.php(1867): Mage_Core_Block_Abstract-&gt;_getChildHtml(''content'', true)\n#31 /var/www/html/mage14/app/design/adminhtml/default/default/template/page.phtml(74): Mage_Core_Block_Abstract-&gt;getChildHtml(''content'')\n#32 ...src/__default.php(2634): include(''/var/www/html/m...'')\n#33 ...src/__default.php(2670): Mage_Core_Block_Template-&gt;fetchView(''adminhtml/defau...'')\n#34 ...src/__default.php(2687): Mage_Core_Block_Template-&gt;renderView()\n#35 ...src/Mage_Adminhtml_Block_Template.php(81): Mage_Core_Block_Template-&gt;_toHtml()\n#36 ...src/__default.php(2074): Mage_Adminhtml_Block_Template-&gt;_toHtml()\n#37 ...src/__default.php(23811): Mage_Core_Block_Abstract-&gt;toHtml()\n#38 ...src/__default.php(11222): Mage_Core_Model_Layout-&gt;getOutput()\n#39 /var/www/html/mage14/app/code/core/Mage/Adminhtml/controllers/Sales/Order/InvoiceController.php(265): Mage_Core_Controller_Varien_Action-&gt;renderLayout()\n#40 ...src/__default.php(11251): Mage_Adminhtml_Sales_Order_InvoiceController-&gt;newAction()\n#41 ...src/__default.php(15150): Mage_Core_Controller_Varien_Action-&gt;dispatch(''new'')\n#42 ...src/__default.php(14752): Mage_Core_Controller_Varien_Router_Standard-&gt;match(Object(Mage_Core_Controller_Request_Http))\n#43 ...src/__default.php(16949): Mage_Core_Controller_Varien_Front-&gt;dispatch()\n#44 /var/www/html/mage14/app/Mage.php(596): Mage_Core_Model_App-&gt;run(Array)\n#45 /var/www/html/mage14/index.php(78): Mage::run('''', ''store'')\n#46 {main}<br /></pre>\n</span></pre>\n</span></p>', 'http://www.collinsharper.com/ecommerce_updates/magento_Invalid_model_for_shipping_method/', 0, 1),
(88, 3, '2011-10-15 08:57:37', 'New Chase Paymentech Payment extension for Magento!', 'We are happy to announce that CollinsHarper has released a new <a href="http://www.collinsharper.com/magento-chase-paymentech-onsite-credit-card-payment-module.html">Chase Paymentech Payment extension</a> for Magento. Chase Paymentech is a leading credit card processor providing fast, secure and innovative payment options for companies of every size all over the world. This module requires Ioncube.\n<h2></h2>\n<strong>Benefits:</strong><h4></h4></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Save time and money with easy, versatile implementation options</br></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Protect customer data and boost compliance efforts</br></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Automate your recurring payments</br></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Enjoy peace of mind with seamless, secure connectivity</br>\n<h2></h2>\nWith our Chase Orbital Gateway module, you can establish secure online transaction processing in a one-stop shop environment. This module supports FULL Magento integration, which means that in addition to the integration with Frontend Checkout, you can now take Payments in the Admin Area, making it easier to take Phone orders.\n<h2></h2>\n<strong>Highlights:</strong><h4></h4></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Full suite of payment options: The Orbital Gateway supports MasterCard®, Visa®, American Express®, Diners Club®, Discover Card® and our Gift Card programs</br></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> The Orbital Gateway Module allows you to submit all transaction types such as authorization, authorization and capture, prior authorization, capture, refund, void, inquiry, and an end of day (batch)</br></br>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Given the inherent risks associated with processing transactions over the Internet, the Orbital Gateway requires both encrypted traffic to prevent interception of the payload and authentication\n<h2></h2>\n<div>We offer both a Community Edition and Enterprise Edition for this module. This extension has been tried and tested on the latest Magento version and is also available on <a href="https://www.magentocommerce.com/magento-connect/developer/CollinsHarper#extensions">Magento Connect</a>. If you need more information about the Chase Paymentech integration for Magento don''t hesitate to <a href="http://www.collinsharper.com/chlabs/public/index.php?path_info=submit">contact us</a> and we''ll be glad to help you.</div><h2></h2>\n<img src="http://www.collinsharper.com/skin/frontend/default/collinsharper/images/collinsharper.png"></a>', 'http://www.collinsharper.com/ecommerce_updates/chase_paymentech/', 0, 1),
(89, 3, '2011-10-15 09:36:19', 'Our Extensions Page on Magento Connect', '<img src="http://custommagentodevelopment.files.wordpress.com/2011/10/thumb.jpg"  title="Magento Connect"  width="140" height="140" align="left"/>  \nLook out for our extensions page on the Magento Commerce website!  You can find us on <a href="https://www.magentocommerce.com/magento-connect/developer/CollinsHarper#extensions"> Magento Connect here</a>.\n<h2></h2>\n  We''ve got plenty planned but if you are after a specific extension do let us know!\n<h2></h2>\nHere are our newest modules just added to Magento Connect:\n<li> Chase Paymentech Payment Module</li>\n<li>Beanstream Tokenization Payment module</li>\n<h2></h2>\nWhat kind of extension would you like to see us develop? Leave a comment below and tell us what you think!\n<h2></h2>\n<a href="http://collinsharper.com/"><img class="alignnone size-full wp-image-16" title="CollinsHarper" src="http://custommagentodevelopment.files.wordpress.com/2011/10/collinsharper.png" alt="" width="240" height="117" /></a>', 'http://www.collinsharper.com/ecommerce_updates/magento_connect/', 0, 1),
(90, 3, '2011-10-20 08:39:13', 'Provide another level of security with Beanstream Tokenization', 'Want to keep your customers on site without the risks associated with storing credit card data? The <a href="http://www.collinsharper.com/magento-beanstream-tokenization-onsite-credit-card-payment-module.html">Beanstream Tokenization payment module</a> is the solution!\n<h2></h2>\nThe Beanstream Tokenization payment module lets merchants create secure payment accounts for their customers. Because everything is secured at Beanstream, merchants can minimize the need for repeat data entry the next time a customer shops at their store.\n<h2></h2>\nThis module is 100% PCI compliant - PCI compliance being a security standard to help merchants protect credit card data, both online and offline, for all types of credit cards. PCI Data Security Standard (PCI DSS) helps protect consumers against identity theft as well as credit card data theft. Each step taken toward PCI compliance provides another level of security.\n<h2></h2>\nLimit your online credit card processing risk while providing a great payment experience for your clients. Customers can add multiple cards, delete cards and reuse the same card with confidence. This module requires ioncube.\n<h2></h2>\n<strong>Highlights</strong>\n<h2></h2>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Serve your valued clients</br>\nDid you know repeat shoppers also tend to make larger dollar purchases? Treat your most valuable clients to an optimal payment experience - don''t burden them with duplicate data entry.\n<h2></h2>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Simplify PCI - keep customers on site</br>\nIt''s the big e-store debate - struggle with PCI certification or host payment pages offsite. The Beanstream Tokenization payment module solves the issue. You''ll be up and running faster and with the solution you need.\n<h2></h2>\n<img src="http://www.collinsharper.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/a/c/accept.png"> Streamline manual processing</br>\nNeed to process email or phone orders? The Beanstream Tokenization payment module makes it easy. Create an account once. No need to re-enter card data for repeat orders.\n<h2></h2>\n<strong>How Tokenization Works</strong></br>\nWith Beanstream Tokenization, customers can create their stored cards in the checkout process while running through a standard checkout. Customers can also add cards in the manage stored cards account area.\n<h2></h2>\nIf you need more information about the Beanstream Tokenization integration don’t hesitate to <a href="http://www.collinsharper.com/chlabs/public/index.php?path_info=submit">contact us</a> and we’ll be glad to help you.\n<h2></h2>\n<em>This module supports VBV 3DS Tokenization.</em>\n<h2></h2>\n<strong>\n</strong>\n<h2></h2>\n<a href="http://www.collinsharper.com"><img class="alignnone size-full wp-image-16" title="CollinsHarper" src="http://custommagentodevelopment.files.wordpress.com/2011/10/collinsharper.png" alt="" width="240" height="117" /></a>', 'http://www.collinsharper.com/ecommerce_updates/beanstream_tokenization/', 0, 1),
(91, 4, '2013-01-16 09:32:07', 'Imagine 2013 Registration is Now Open!', 'Join 1500 merchants, partners, developers and enthusiasts from 35+ countries around the world for Magento’s premier global conference! Collaborate, learn, network and get inspired by the future of eCommerce. Tickets will sell out fast! April 8th – 10th in Las Vegas.', 'https://registration.imagineecommerce.com/', 0, 1),
(92, 4, '2013-02-13 05:23:42', 'Get More eCommerce Power with Magento Enterprise', 'Limited time offer: Get a free, customized evaluation of your Community Edition site from a Magento Solution Partner. This evaluation gives you a clear look at the numerous benefits you can achieve by upgrading to Enterprise Edition. ', 'http://www.magentocommerce.com/community-to-enterprise?utm_source=CEMM&utm_medium=copy&utm_campaign=CE2EE', 0, 1);
