INSERT INTO `catalogsearch_fulltext` (`fulltext_id`, `product_id`, `store_id`, `data_index`) VALUES
(4306, 119, 1, '33|Enabled|Shipping|Reproduction|BRITISH STEN SLING|Authentic British Khaki Sten Sling with WWII date. &nbsp;Great addition to a collection or great for reanactors.|Shipping cost $8.95Combine orders and reduce your shipping costs.|19.95|1'),
(4307, 120, 1, '34|Enabled|Shipping|Reproduction|BRITISH STEN BULLET EXTRACTOR|Great addition to a collection.|Shipping cost $8.95Combine orders and reduce your shipping costs.|16.95|1'),
(4308, 121, 1, '35|Enabled|Shipping|Reproduction|BRITISH "CRICKET" TYPE MAGAZINE LOADER|Great addition to a collection or great for reanactors.|Shipping cost $8.95Combine orders and reduce your shipping costs.|24.95|1'),
(4309, 122, 1, '36|Enabled|Shipping|Reproduction|BRITISH WASH ROLL WWII|Great condition, never Used. &nbsp;Marked McNamara Motors Limited W D 1943. &nbsp;Great addition to a collection or great for reanactors.|Shipping cost $8.95Combine orders and reduce your shipping costs.|14.95|1'),
(4310, 123, 1, '37|Enabled|Shipping|Reproduction|14 PIECE WEB SET BRITISH PATTERN 37|WWII British AuthenticPrice $99.95Comes with large Haversack, two cross straps, two L- straps, small pack, belt, two BREN MKII ammo pouches, field dressing, two shoulder straps for belt, canteen and carrier.Great for reeanacting. &nbsp;This 37 pattern webbing was used in WWII and the Korean war by the British, Canadian and all common wealth forces. &nbsp;Over 50 years old. &nbsp;Post WWII dates.|Shipping cost $18.95Combine orders and reduce your shipping costs.|99.95|1'),
(4311, 124, 1, '38|Enabled|Shipping|Reproduction|BRITISH SPIKE BAYONET 1944 FROG & CANADIAN 1952 FROG|British 37 Pattern 1944 dated spike Bayonet Frog and Canadian 1951 Pattern No. 4 Mk 1 Bayonet Frog dated 1952.Great addition to a collection or great for reeanactors.|Shipping cost $5.95Combine orders and reduce your shipping costs.|9.95|1'),
(4312, 125, 1, '39|Enabled|Shipping|Reproduction|BRITISH 4 MK 2 LEE-ENFIELD SPIKE BAYONET|British #4 MK 2 Lee-Enfield Spike Bayonet and metal sheath. &nbsp;During WWII the need for a cheaper, more easily manufactured bayonet for the Lee Enfield .303 rifle arose. This was the result. A return to the "pig-sticker" style. It was much shorter than the standard bayonet. Blade length was 20cms (8 inches). &nbsp;Also available is the British #4 MK 3 Spike Bayonet Without Scabbard for $14.95|Shipping cost $13.95Combine orders and reduce your shipping costs.|24.95|1'),
(4313, 126, 1, '40|Enabled|Shipping|Reproduction|CANADIAN .455 WEBLEY HOLSTER|New and unissued. &nbsp;Stamped 1943 and C broad arrow.&nbsp;&nbsp; &nbsp;Fits 6 inch barrel, 4 inch barrel, US colt 45, 1917 revolver,38 colt, 1885 to 1943 victory revolvers and the 38 caliber long barrel cowboy.|Shipping cost $7.95Combine orders and reduce your shipping costs.|24.95|1'),
(4314, 127, 1, '5|Enabled|Shipping|Reproduction|GERMAN WWII ID DISK DOG TAG 1/2 DISK|These come from a prisoner of war camp. The picture is just a sample of one of the disks. Each disk has different markings stamped on them. They come in zinc and aluminum. Some have one hole in them, and some have two holes. Sorry but you can not pick out the one you want.|100% Original|19.95|1'),
(4315, 128, 1, '50|Enabled|Shipping|Reproduction|BRITISH WWII ARMY FIELD DRESSINGS LOT OF 2|WWII British Army Field Dressings Lot of two.They are dated from 1941 to 1944 with British makers stamped on them.All are in excellent unused condition. Great addition to a collection or great for reeanactors.|Shipping cost $4.95Combine orders and reduce your shipping costs.|9.95|1'),
(4316, 129, 1, '51|Enabled|Shipping|Reproduction|BRITISH ENFIELD BAYONET 1944 LAST DITCH|1944 &ldquo;Last Ditch&rdquo;&ndash;final production.Square pommel eased manufacture. Scarce issue. The bayonet will fit 1907 Enfield #1,Lancaster Submachine Gun,Enfield #1 Mark 1, 2, 3 &amp; 4, Enfield #4, Mark 1, 2 &amp; 3. Will not fit Enfield #4 Mark 4.|Shipping cost $12.95Combine orders and reduce your shipping costs.|29.95|1'),
(4317, 130, 1, '53|Enabled|Shipping|Reproduction|BRITISH HELMET 1944 PATTERN|Authentic used British Helmet.1944 pattern turtle shell Mark IV Steel helmet.With post WWII liner and chin strap (liner was snap in).This helmet was first issued for use in the D-Day invasion of Europe in 1944. &nbsp;This is the first steel helmet pattern to be adopted by the British after the "Doughboy" style of WWI. This helmet was in use through the close of WW11 and in regular use through Korea and the Falklands.Great for reanactors.|Shipping cost $16.95Combine orders and reduce your shipping costs.|39.95|1'),
(4318, 131, 1, '54|Enabled|Shipping|Reproduction|BRITISH ENFIELD BAYONET 1943|1943 Enfield first production, manufactured during WWII, this is an authentic government issue made for jungle fighting.It is in excellent condition. &nbsp;Scabbard is not available. &nbsp;12" blade. &nbsp;The bayonet will fit 1907 Enfield #1, Lancaster Submachine gun, Enfield #1 Mark 1, 2, and 3. Will not fit Enfield #4 Mark 4. &nbsp;Badge is made of high quality tin alloy and is made as close to original as possible.|Shipping cost $13.00Combine orders and reduce your shipping costs.|29.95|1'),
(4319, 132, 1, '55|Enabled|Shipping|Reproduction|BRITISH WW11 AIRBORNE WATER BOTTLE AND COVER|This pattern of water bottle cover was popular with Airborne soldiers because it was easier to use and can be seen being carried by many in Arnhem battle pictures.Water bottle and cover are unissued and war time dated. Great for display or reenacting.|Shipping cost $9.95Combine orders and reduce your shipping costs.|14.95|1'),
(4320, 133, 1, '56|Enabled|Shipping|Reproduction|BRITISH WWII HELMET CHIN STRAP|WWII original British helmet chin strap. Unissued woven khaki cotton material with blackened brass buckle. A heavy spring, covered with khaki cotton material, is attached to each end of the strap. A thin brass loop on each end fits onto helmet. Strap is in un-issued condition and complete with everything you need to up grade or replace a missing British chinstrap. Great addition to a collection or great for reanactors.|Shipping cost $3.00 Combine orders and reduce your shipping costs.|11.95|1'),
(4321, 134, 1, '57|Enabled|Shipping|Reproduction|BRITISH P-37 BREN GUN POUCHES, BELT & STRAPS|British Pattern 37 - 5 piece web set.Comes with belt, two Bren MkII ammo pouches and two shoulder straps. &nbsp;This 37 pattern webbing was used in WWII and the Korean War by the British, Canadian and all common wealth forces. Over 50 years old. Post WWII dates. &nbsp;Great addition to a collection or great for reanactors.|Shipping cost $12.95Combine orders and reduce your shipping costs.|34.95|1'),
(4322, 135, 1, '58|Enabled|Shipping|Reproduction|CHIN STRAP FOR MKII HELMET (TOMMY)|Reproduction Mid-war chinstrap. This was also used on the Canadian D-day helmet or Turtle shell helmet.|Shipping cost $3.00Combine orders and reduce your shipping costs.|9.95|1'),
(4323, 136, 1, '59|Enabled|Shipping|Reproduction|BRITISH 4 MK 2 LEE-ENFIELD SPIKE BAYONET|British #4 MK 2 Lee-Enfield Spike Bayonet and metal sheath. &nbsp; During WWII the need for a cheaper, more easily manufactured bayonet for the Lee Enfield .303 rifle arose. This was the result. A return to the "pig-sticker" style. It was much shorter than the standard bayonet. Blade length was 20cms (8 inches). &nbsp; Also available is the British #4 MK 3 Spike Bayonet Without Scabbard for $14.95|Shipping cost $13.95Combine orders and reduce your shipping costs.|24.95|1'),
(4324, 137, 1, '6|Enabled|Shipping|Reproduction|WWII ITALIAN FIELD DRESSINGS MODEL 1931|Two original WWII Italian medical field dressings MODEL 1931 REGIO ESERCITO ITALIANO.These 2 dressings are in good unissued condition. &nbsp;The bandages came in wrapped bundles that had a tag that say 1941 I.C.F.M.These were used by the Germans in large quantities when supplies were running low near end of the war. &nbsp;TA common occurance as the Germans took and used everything from the Italians after the Italians surrendered.|Combine orders and reduce your shipping costs.|11.95|1'),
(4325, 138, 1, '06-295|Enabled|Shipping|Reproduction|SS LEADER''S SWORD|Price $99.00Reproduction06-295Classic SS officer''s sword was first introduced in 1938. Features SS runic badge inserted into wood grip, 29" carbon steel blade with blood groove.Length: 39&rdquo;Weight: 2.5 lbs.|Shipping cost $20.00Combine orders and reduce your shipping costs.|99.95|1'),
(4326, 139, 1, '06-299|Enabled|Shipping|Reproduction|LUFTWAFFE OFFICER''S SWORD|Price $179.00Reproduction06-299This handsome WWll sword measures 39.5" and features a 30.5" polished carbon steel blade, silver pommel and hand guard stamped with swastika, midnight blue leather scabbard with silver fittings.Overall length 39.5" Weight 2 lbs.|Shipping cost $20.00Combine orders and reduce your shipping costs.|179|1'),
(4327, 140, 1, '60|Enabled|Shipping|Reproduction|GERMAN M42 ORIGINAL SHELL STEEL HELMET|This is an original M42 German WWII ET66 shell with a reproduction 58-59 liner or a 60 liner. &nbsp;It has been expertly restored with new paint and a high quality liner. &nbsp;These original 66 shells are hard to come by. &nbsp;This helmet is also available in M35.Helmet Size 66.|Shipping cost $16.95Combine orders and reduce your shipping costs.|249|1'),
(4904, 717, 1, 'YOUTH-KNIVES|Enabled|Shipping|Reproduction|HITLER YOUTH KNIFE|Price $24.95 for one knifePrice $99.95 for five knivesReproductionReplicated from the original 1937 weapon, this Hitler Youth Knife is manufactured with a 6 1/2" etched blade. The handle is constructed with a black checkered grip with enamel HJ swastika insert. Also included is an impact resistant sheath. 10 3/4" overall.These are selling at a discount from the other versions made in Germany. These are made in China and are excellent quality.|Shipping cost $12.95 for ONE (1)Shipping cost $17.95 for FIVE (5)Combine orders and reduce your shipping costs.|24.95|1'),
(4903, 716, 1, 'Y HOOKS-123|Enabled|Shipping|Reproduction|GERMAN Y STRAP FRONT HOOKS|Price $11.95ReproductionThese are a set of two replacement front hooks for the German WWII leather y straps. Copied from originals.|Shipping cost $6.95Combine orders and reduce your shipping costs.|6.95|1'),
